import React from 'react';
import './NotFound.css';
import Frame from '../Images/Frame 14.svg'
import Camera from '../Images/camera.svg'
import Rectangle from '../Images/Rectangle 1 copy 4.svg'
import Artwork from '../Images/PUT ARTWORK HERE.svg'
import Shape3 from '../Images/Shape 3 copy 2.svg'
import Shape2 from '../Images/Shape 2 copy 2.svg'
import touchpad from '../Images/touchpad.svg'
import Frame2 from '../Images/Frame 33.svg'
import ellipse from '../Images/Ellipse 1.png'

function NotFound() {
  return (
    <div className="macbook-img">

      <img className="camera" width="5px" height="5px" src={Camera} alt="camera" />
      <img className="macbook-imgs" src={Rectangle} alt="macbook background" />
      <img className="artwork" width="730px" height="470px" src={Artwork} alt="artwork" />
      <img className="shape" width="890px" height="17px" src={Shape3} alt="shape" />
      <img className="shape-2" width="945px" height="7.5px" src={Shape2} alt="shape-2" />
      <img className="touchpad animation-ong" width="135px" height="4.75px" src={touchpad} alt="touchpad" />

    </div>
  );
}

export default NotFound;
